import { FETCH_MYLIST } from '../actions/index';

export default function (state = {}, action) {
    switch (action.type) {
      case FETCH_MYLIST:
        const data = action.payload.mylist;
        // const data = action.payload.data;
        return { ...state, data }
      default:
        return state;
    }
  }
